class App extends Component{
    onSubmit(e){
        e.preventDefault();

        console.log(e.target.value);        
    }
    render(){
        const list = [
            'Itme 1',
            'Item 2',
            'Item 3'
        ]
        return (
            <div className= "App">
                <h1>
                    {
                        list.map(item => {
                            return (
                                <div key={item} onMouseEnter={this.OnMouseEnter}> {item}</div>
                             )
                        })
                    }
                    </h1>
                    <form onSubmit={this.onSubmit}>
                         <input onChange={this.onChange} />
                    </form>
            </div>
        )
    }
}

export default App;
